            <p className={styles.contactInfo}>
                Tel: (646) 330-3584 | Fax: (347) 597-5615 | Email: adrian@tokaconstruction.com | Web: www.tokaconstruction.com
            </p>
        </footer>
    );
}

export default Footer;
